import React from 'react';

function About() {
    return (
        <div className="about-container">
            <div className="about-section">
                <h1 className="about-title">About</h1>
                <p className="about-description">spacefaXcts is a collection of projects NASA has undertaken since it's inception;<br/>
                    mainly it's Mars missions, as well as other space related facts.<br/>
                    <br/>
                    Discover facts about space you've never knew!<br/>
                    <br/>
                    a project by Nigel Tay

                </p>
            </div>
        </div>
    );
}

export default About;
